let calendar = null;


const getData = async () => {

    let workbook = XLSX.read(await(await fetch("./excel/The_Sunflower.xlsx")).arrayBuffer());
  
    var first_sheet_name = workbook.SheetNames[0];
    /* Get worksheet */
    var worksheet = workbook.Sheets[first_sheet_name];
    return XLSX.utils.sheet_to_json(worksheet,{raw:true});
    
    
};
const putDataToVariable = async () => {
    const variable = await getData()
    console.log(variable)
  }

