    $('#search-year').keyup(function(event){
        if(event.keyCode === 13)
        {
            $('#update-current-year').click();
        }
    })

    //addded text box and upadte and reset btn to go on perticular year
    let letters = /^[A-Za-z]+$/;
    document.querySelector('#update-current-year').addEventListener('click', function() {
        if(document.querySelector('#search-year').value < 1926 || document.querySelector('#search-year').value > 1978 || 
        document.querySelector('#search-year').value.match(letters)) //check year limits
        {
            document.querySelector('#errorBox').value = "Please Select a valid Year!";
            
        }
        else{
            calendar.setYear(document.querySelector('#search-year').value); //upadte the year
        }
       
      });
     
    
